package com.example.asm_java_nangcao1.Model;public class chiTietGioHang_Model {    private String idChiTietGioHang;    private String anhSanPham;    private String tenSanPham;    private String giaSanPham;    private int soLuongSanPham;    public chiTietGioHang_Model() {    }    public chiTietGioHang_Model(String idChiTietGioHang, String anhSanPham, String tenSanPham, String giaSanPham, int soLuongSanPham) {        this.idChiTietGioHang = idChiTietGioHang;        this.anhSanPham = anhSanPham;        this.tenSanPham = tenSanPham;        this.giaSanPham = giaSanPham;        this.soLuongSanPham = soLuongSanPham;    }    public String getIdChiTietGioHang() {        return idChiTietGioHang;    }    public void setIdChiTietGioHang(String idChiTietGioHang) {        this.idChiTietGioHang = idChiTietGioHang;    }    public String getAnhSanPham() {        return anhSanPham;    }    public void setAnhSanPham(String anhSanPham) {        this.anhSanPham = anhSanPham;    }    public String getTenSanPham() {        return tenSanPham;    }    public void setTenSanPham(String tenSanPham) {        this.tenSanPham = tenSanPham;    }    public String getGiaSanPham() {        return giaSanPham;    }    public void setGiaSanPham(String giaSanPham) {        this.giaSanPham = giaSanPham;    }    public int getSoLuongSanPham() {        return soLuongSanPham;    }    public void setSoLuongSanPham(int soLuongSanPham) {        this.soLuongSanPham = soLuongSanPham;    }}